onMounted(() => {
  nextTick(() => {
    function getRandom(min, max) {
      return Math.random() * (max - min) + min
    }

    const stars = document.querySelectorAll('.animate-sparkle')

    stars.forEach((star, index) => {
      const delay = getRandom(0, 3) + 's'

      star.style.animationDelay = delay
    })
  })
})
